import React from 'react'

export const Main_Logo = (props) => {
    
    return(
        <React.Fragment>
            <a href="/">
            <img src='1_image_or_icon\food_script_logo.png'
            id='Main_Logo' />
            </a>
        </React.Fragment>
    )
}

export default Main_Logo
